const Course = ({ course }) => {
  return (
    <div>
      <h1>
        {course.name}
      </h1>
      <ul>
        {course.map(parts => <p>{parts.name} {parts.exercises}</p>)}
      </ul>
    </div>

  )

}
export default Course
